import React from "react";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import {StyledCard, StyledCardMedia} from "./styles";
import lockImg from "../../assets/images/lock-icon.png"
import Input from "@mui/material/Input";

const Login = () => {



	return (
			<StyledCard sx={{ maxWidth: 345 }}>
				<StyledCardMedia
					component="img"
					src={lockImg}
					alt="green iguana"
				/>
				<CardContent>
					<Typography gutterBottom variant="h5" component="div">
						Please Sign
					</Typography>
					<Typography variant="body2" color="text.secondary">
						Welcome to Go REST API.
					</Typography>
					<Input name='username' placeholder="Username" fullWidth />
					<Input name='password' placeholder="Password" fullWidth />
				</CardContent>
				<CardActions>
					<Button size="small">Login</Button>
				</CardActions>
			</StyledCard>
	);
};

export default Login;
